(3, 10, '0', '', 'contact-us', '', '0', '0', '<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #000000; font-size: 10pt;\">For General Queries:<br /><br /><br /></span></p>\n<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #0000ff; font-size: 10pt;\"><span lang=\"zxx\"><span style=\"text-decoration: underline;\"><a>info@tabula.mobi</a> <br /><br /><br /><br /><br /></span></span></span></p>\n<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #000000; font-size: 10pt;\"><br /><br />For Booking Queries:<br /><br /><br /></span></p>\n<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #000000; font-size: 10pt;\"><a href=\"mailto:admin@tabula.mobi\">admin@tabula.mobi</a></span></p>\n<p style=\"margin-bottom: 0cm; line-height: 0.18cm;\">&nbsp;<br /><br /></p>\n<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #000000; font-size: 10pt;\"><br />For Advertising Queries:<br /><br /><br /></span></p>\n<p style=\"margin-left: 1.27cm; margin-bottom: 0cm; line-height: 0.10cm;\" align=\"CENTER\"><span style=\"color: #0000ff; font-size: 10pt;\"><span lang=\"zxx\"><span style=\"text-decoration: underline;\"><a>advertising@tabula.mobi</a> </span></span></span></p>', '', '', 1, '2017-02-09 06:13:16', 123, '2017-02-09 06:13:16', 123),
(4, 4, '0', '', 'terms-and-condition', '', '0', '0', '1. Introduction <br /><br />1.1. This document sets out these Terms and Conditions (hereinafter referred to as &ldquo;these Terms and Conditions&rdquo;) of Shelf Company Name t/a Tabula and company registration no. (hereinafter referred to as &ldquo;Tabula&rdquo;) pertaining to the access and use of the information, products, services and functions provided on www.tabula.mobi and by any mobile application inter alia launched, licensed and/or owned by Tabula (hereinafter referred to as &ldquo;this Site&rdquo;). <br /><br />1.2. Should any person that accesses this Site you (hereinafter referred to as &ldquo;you&rdquo; or &ldquo;user&rdquo;) disagree with any of these Terms and Conditions, you must refrain from accessing this Site and/or utilising any of our Services as set out below (hereinafter collectively referred as the &ldquo;Services&rdquo;):-<br /><br />Restaurant Reservation Services<br /><br />1.2.1. Tabula provides you with Restaurant Reservation Services in order to assist you in securing dining reservations at participating third party restaurants (hereinafter referred to as a &ldquo;Restaurant&rdquo;). <br /><br />1.2.2. In response to your online request for a Restaurant reservation through this Site, Tabula will proceed to directly contact the Restaurant&rsquo;s computerised database of reservations. All reservations availability will be determined at the time of your reservation request. <br /><br />1.2.3. Once a reservation is made by you through this Site, Tabula will provide confirmation of the reservation to you by email. By using the Restaurant Reservation Services offered by this Site you hereby agree to receive your Restaurant reservation confirmations by email after booking.<br /><br />1.2.4. No-Show Policy:- <br /><br />1.2.4.1. Tabula is committed to providing superior quality Services to you and to Restaurants. In order for us to maintain a consistently high level of service for the Restaurants and their patrons, you hereby undertake to cancel any reservations that you will be unable to honor at least 30 (thirty) minutes in advance of the reservation time;<br /><br />1.2.4.2. you may cancel your reservation via this Site or by contacting the Restaurant directly;<br /><br />1.2.4.3. some Restaurants may require a debit or credit card number to finalise your reservation. In order to use the Restaurant Reservation Services for these Restaurants, you will be obliged to provide valid debit or credit card information and in order to ensure the debit or credit card information provided is accurate, Tabula reserves its right to place a temporary authorisation on your debit or credit card at the time you provide same. After we verify that your debit or credit card information is accurate, usually within a few days, the authorisation will be removed;<br /><br />1.2.4.4. please be advised that in some instances you may be required to cancel your Restaurant reservation in accordance with the Restaurant&rsquo;s cancellation policy, which may be disclosed at the time the reservation is made. Tabula uses this debit or credit card information as described in our privacy policy and shall have no liability for any charges made to the debit or credit card account for any failure to cancel your reservation in accordance with a Restaurant&rsquo;s cancellation policy;<br /><br />1.2.4.5. you hereby undertake to hold Tabula harmless against any claims for alleged damages or losses suffered as a result of a Restaurant&rsquo;s failure to disclose its cancellation policy;<br /><br />1.2.4.6. in the event of you being unable to keep your reservation and you fail to cancel at least 30 (thirty) minutes in advance of the Restaurant reservation or not in accordance with the Restaurant&rsquo;s cancellation policy, Tabula will send you an email letting you know that our records indicate that you were a no-show; and<br /><br />1.2.4.7. by using the Restaurant Reservation Services, you agree to receive no-show notifications by email after a report that your Restaurant reservation was not honored, whether or not that was in fact the case. Tabula reserves its rights to terminate your account in the event that you are a no-show for at least 4 (four) reservations within a 12 (twelve) month period. If you receive a no-show notification email in error, please contact Tabula as per the contact details contained in clause 14 below for information on how to dispute same. You furthermore agree that all final no-show determinations will be made by Tabula in its sole and absolute discretion.<br /><br />1.2.5. Usage Guidelines:-<br /><br />1.2.5.1. You the user hereby agree to use the Restaurant Reservation Services to book reservations at Restaurants and then honor those reservations by arriving at the Restaurants on time and ordering and paying for meals. <br /><br />1.2.5.2. You as the user furthermore agree to not book more than one Restaurant reservation for your personal use during any one meal time (e.g., lunch, dinner, etc.). Resale or attempted resale of Restaurant reservations is prohibited and will be grounds for, among other things, cancellation of your reservations, termination of your access to the Services and/or Tabula reserves its rights to claim any damages and/or losses suffered as a result thereof.<br /><br />1.3. If you are under the age of 18, you must obtain your parents&rsquo; or legal guardians&rsquo; advance authorization, permission and consent to be bound by these Terms before purchasing any products or services offered by Tabula.<br /><br />1.4. Tabula reserves the right, in its sole discretion, to amend and/or replace any of, or the whole of, these Terms and Conditions. Such amendments shall supersede and replace any previous Terms and Conditions that shall be made available on this Site. Each time a user accesses this Site and/or uses the Services, the user shall be deemed to have consented, by such access and/or use, to these Terms and Conditions, as amended and/or replaced by Tabula from time to time. If you are not satisfied with the amended Terms and Conditions, you should refrain from using this Site.<br /><br />1.5. We will however give you prior notice where we have collected personal information from you and the purpose for which we collected that information, is affected by the intended amendment.<br /><br />1.6. If there is anything in these Terms and Conditions that you do not understand then please contact us as soon as possible in terms of clause 14 below for contact details. Please note that calls to us are charged at national rates and may be monitored for training, security and quality assurance purposes.<br /><br />1.7. Any personal details and/or information recorded by yourself on this Site are solely for the purpose of enhancing our Services offered to you and confirm that we have no intention of selling such personal details and/or information.<br /><br />2. Content of this Site <br /><br />2.1. Tabula reserves the right to make improvements, to change or to discontinue, without notice, any aspect or feature of this Site and any information or content on this Site. <br /><br />2.2. Tabula reserves the right, if applicable, to change and amend the products, Services, prices and rates quoted on this Site from time to time without notice.', '', '', 1, '2017-02-09 05:58:31', 123, '2017-02-09 05:58:31', 123),
(5, 9, '0', '', 'privacy-policy', '', '0', '0', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. When an unknown printer took a galley of type and scrambled it to make a type specimen book.It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '', '', 1, '2017-02-09 06:07:32', 123, '2017-02-09 06:07:32', 123),
(6, 8, '0', '', 'about-us', '', '0', '0', 'Tabula is South Africa\'s latest mobile app helping guests discover restaurants, make bookings and get personalized, real-time service. <br /><br />We offer an alternative booking system that will better the needs of both restaurants and diners. Our service is instant, effortless and convenient. <br /><br />Restaurant partners will experience fewer cancellations, improve customer service and receive actionable data that helps them better understand their business.', '', '', 1, '2017-02-09 05:51:35', 123, '2017-02-09 05:51:35', 123),
